import React from 'react';
import { Link } from 'react-router-dom';
import './index.css';

function Home() {
  return (
    <div className="container">
      <img src="/logo.png" alt="SoulCare Logo" className="logo" />
      <h1>Willkommen bei SoulCare</h1>
      <div>
        <Link to="/chattherapy">
          <button>Chat Therapy</button>
        </Link>
        <Link to="/contact">
          <button>Contact</button>
        </Link>
        <Link to="/journal">
          <button>Journal</button>
        </Link>
        <Link to="/meditation">
          <button>Meditation</button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
